DO $$
BEGIN
  BEGIN
    EXCEPTION
      WHEN OTHERS THEN
        PERFORM setval(pg_get_serial_sequence('EMPLOYEE', 'EMPLOYEE_ID'), 1, false);
        PERFORM setval(pg_get_serial_sequence('SUBSYSTEM', 'SUBSYSTEM_ID'), 1, false);
        PERFORM setval(pg_get_serial_sequence('POWERUNIT', 'POWERUNIT_NUMBER'), 1, false);
        PERFORM setval(pg_get_serial_sequence('FUEL_ROAD', 'FUEL_ROAD_NUMBER'), 1, false);
        PERFORM setval(pg_get_serial_sequence('FUEL_TYPE', 'FUEL_TYPE_ID'), 1, false);
        PERFORM setval(pg_get_serial_sequence('EVENT', 'EVENT_ID'), 1, false);
        ROLLBACK;
        RAISE;
    END;
    COMMIT;
END $$;
